// Imports from MUI lib
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import React from 'react'
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import TabPanel from '@mui/lab/TabPanel';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
//import TabIndicator from '@mui/lab/TabIndicator';
import { useHistory, useLocation } from 'react-router-dom';

import './Navbar.css'
// Create navbar
const pages = ['About', 'Projects', 'Contact'];

const pagePaths = {
    About: '/about',
    Projects: '/projects',
    Contact: '/contact',
};

function Navbar() {
    const [value, setValue] = React.useState('one');

    // const handleChange = (event, newValue) => {
    //     setValue(newValue);
    // };

    const history = useHistory();
    const location = useLocation();

    const handleChange = (event, newValue) => {
        history.push(pagePaths[newValue]);
    };

    return (
        /*<AppBar position='sticky'>
            <Container maxWidth='xl'>
                <Toolbar disableGutters>
                    <div><img src='logo.png' width='50' height='50' alt='logo'/></div>
                    <Typography
                        variant='h6'
                        noWrap
                        component='a'
                        href='/'
                        sx={{
                            mr: 1.5,
                            display: { xs: 'none', md: 'flex' },
                            fontFamily: 'monospace',
                            fontWeight: 700,
                            letterSpacing: '.2rem',
                            color: 'inherit',
                            textDecoration: 'none',
                        }}
                    >
                        &nbsp;Kfir Tayar {/!* Code for one space: &nbsp; *!/}
                    </Typography>
                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                        <Button
                            key={pages[0]}
                            href={'/'}
                            sx={{ my: 2, color: 'white', display: 'block' }}
                        >
                            {pages[0]}
                        </Button>
                        <Button
                        key={pages[1]}
                        href={'/projects'}
                        sx={{ my: 2, color: 'white', display: 'block' }}
                        >
                             {pages[1]}
                        </Button>
                            <Button
                            key={pages[2]}
                            href={'/contact'}
                            sx={{ my: 2, color: 'white', display: 'block' }}
                            >
                        {pages[2]}
                            </Button>
                    </Box>
                </Toolbar>
            </Container>
        </AppBar>*/

        <TabContext value={location.pathname}>
            <Box sx={{ width: '100%' }}>
                <TabList
                    onChange={handleChange}
                    aria-label="wrapped label tabs example"
                >
                    {pages.map((page) => (
                        <Tab key={page} value={page} label={page} />
                    ))}
                </TabList>
            </Box>

            {pages.map((page) => (
                <TabPanel key={page} value={pagePaths[page]}>
                    {/* Content for each page */}
                    <div>{page} Page Content</div>
                </TabPanel>
            ))}
        </TabContext>
    );
}
export default Navbar;
